<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width,height=device-height,initial-scale=1.0,maximum-scale=1.0, minimum-scale=1.0,user-scalable=no,viewport-fit=cover">
    <link rel="icon" href="<%= BASE_URL %>favicon.ico">
    <title><%= htmlWebpackPlugin.options.title %></title>

    <script src="<%= BASE_URL %>static/lib/jQuery/jquery-3.4.1.min.js"></script>
    <!-- <script src="https://cdn.jsdelivr.net/npm/vue@2.6.11"></script>
    <script src="https://unpkg.com/vue-router@3.1.5/dist/vue-router.js"></script>
    <script src="https://unpkg.com/vuex@3.1.2"></script> -->
    <% if(process.env.NODE_ENV==='production'){htmlWebpackPlugin.options.cdn.js.forEach(item => {%>
    <script src="<%= item %>"></script><%})}%>
    <div id="risk-assess-app"></div>
    <!-- built files will be auto injected -->
  </body>
</html>
